import React from "react";
import logo from "./res/logo.png";
import "./components/App.css";
import styled from "styled-components";

const Logo = styled.img`

`;

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Logo src={logo} alt="Logo de Bonap"/>

      </header>
    </div>
  );
}

export default App;
